import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
  state= {
    movies: []
  }

  componentDidMount() {
    fetch('/users')
      .then(res => res.json())
      .then(result => this.setState({ movies: result.rows }));
  }

  render() {
    return (
      <div className="App">
        <h1>Movies</h1>
        <ul>
          {this.state.movies.map(movie =>
            <li
              key={movie.id}>
              {movie.title}
             </li>
           )}
        </ul>
      </div>
    );
  }
}

export default App;
